import './Create.css';
import Header from '../Header/Header.js';
import Toaster, {toast} from 'react-hot-toast';

function BuildInitPage() {

    const notify = () => toast('Hello World', {
        duration: 4000,
        position: 'top-center',

        // Styling
        style: {},
        className: '',

        // Custom Icon
        icon: 'üëè',

        // Change colors of success/error/loading icon
        iconTheme: {
          primary: '#000',
          secondary: '#fff',
        },

        // Aria
        ariaProps: {
          role: 'status',
          'aria-live': 'polite',
        },
      });;

    return (
        <div className='creation-box'>
            <span className='textBox'>
                FILL OUT THE FORM TO CREATE A REDEMPTION POOL
            </span>
            <form id="creationForm">
                <span>
                    <label>
                        Collection symbol:
                    </label>
                    <input type='text' placeholder='Cycle'></input>
                </span>
                <span>
                    <label>
                        Supply:
                    </label>
                    <input type='text' placeholder='5555'></input>
                </span>
                <span>
                    <label>
                        Mintprice (SOL):
                    </label>
                    <input type='text' placeholder='1 SOL'></input>
                </span>
                <span>
                    <label>
                        Redemption rate:
                    </label>
                    <input type='number' min={1} max={100} placeholder='1 - 100'></input>
                </span>
            </form>
            <div className='disclaimer'>
                <p>
                    Submitting the form does not create a pool automatically! <br></br>
                    Our team is devoted to delivering the highest security standards possible and will manually review each submission.
                </p>
            </div>
            <div className='btnBox'>
                <button className='submitBtn' onClick={() => notify()}>
                    Submit
                </button>
            </div>
        </div>
    )
}

function Create() {
  return (
    <div id="create">
        <Header />
        <BuildInitPage />
        <Toaster 
            position="bottom-left"
            reverseOrder={false}
        />
    </div>
  );
}

export default Create;
